import React from "react";


const User = ({ usuario }) => (
 
<div className="repoListContainer">
  <lu>
   <li><img  src="{usuario.avatar_url}"></img>{usuario.followers}</li>
   <li>{usuario.following}</li>
   <li>{usuario.avatar_url}</li>
   <li>{usuario.email}</li>
   <li>{usuario.bio}</li>
   </lu>
  
</div>


);




export default User;
